BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "payments" (
	"id"	,
	"comment"	,
	"final_amount"	,
	"reduction"	,
	"encounter"	
);
CREATE TABLE IF NOT EXISTS "encounter_codes" (
	"id"	INTEGER,
	"code"	INTEGER,
	"comment"	TEXT,
	"is_roe"	TEXT,
	"encounter"	INTEGER,
	PRIMARY KEY("id" ASC),
	FOREIGN KEY("encounter") REFERENCES "encounters"("id") ON DELETE CASCADE ON UPDATE CASCADE
);
;
CREATE TABLE IF NOT EXISTS "patients" (
	"id"	INTEGER NOT NULL,
	"active"	INTEGER,
	"address"	TEXT,
	"birthdate"	TEXT,
	"cin"	TEXT,
	"city"	TEXT,
	"createdon"	TEXT,
	"filenum"	TEXT NOT NULL UNIQUE,
	"firstname"	TEXT NOT NULL,
	"gender"	TEXT,
	"insured"	INTEGER,
	"job"	TEXT,
	"landline"	TEXT,
	"lastname"	TEXT NOT NULL,
	"mobile"	TEXT,
	"postalcode"	INTEGER,
	"createdby"	TEXT,
	"email"	TEXT,
	PRIMARY KEY("id" ASC AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "encounters" (
	"id"	INTEGER,
	"timestamp"	TEXT,
	"createdby"	TEXT,
	"patient"	TEXT NOT NULL,
	"status"	TEXT,
	"end_timestamp"	TEXT,
	"start_timestamp"	TEXT,
	PRIMARY KEY("id" ASC),
	FOREIGN KEY("patient") REFERENCES "patients"("filenum") ON UPDATE CASCADE
);
CREATE TABLE IF NOT EXISTS "areas" (
	"id"	,
	"area"	,
	"timestamp"	,
	"createdby"	,
	"patient"	,
	PRIMARY KEY("id" ASC),
	FOREIGN KEY("patient") REFERENCES "patients"("filenum") ON UPDATE CASCADE
);
CREATE INDEX IF NOT EXISTS "index_patients_lastname_firstname" ON "patients" (
	"firstname",
	"lastname"
);
COMMIT;
